import React from 'react';
import styles from './Navbar.module.css';

const Navbar = () => {
  const nav = ['Profile', 'Messages', 'News', 'Music', 'Settings'];

  return (
    <nav className={styles.nav}>
      {/* {nav} */}
      <div className={styles.item}>
        <a>Profile</a>
      </div>
    </nav>
  );
};
export default Navbar;
